import Navbar from '../components/Navbar';
import '../styles/global.css';
import '../styles/sample.css';
import Footer from '../components/Footer';

function Sample() {
    const gridHeaders = ['A', 'B', 'C', 'D', 'E', 'F', 'G', 'H', 'I', 'J'];
    const rows = [
        ['','','','','√','√','√','√','','',''],
        ['','','','','','','','','','',''],
        ['','','','','','','X','','','',''],
        ['','','','','','','X','','','',''],
        ['X','√','√','','','X','','','',''],
        ['','','','','X','','','','','',''],
        ['','','','','X','','','','','',''],
        ['','','','','X','','','','','',''],
        ['','','','','X','','','','','',''],
        ['','','','','X','','','','','','X'],
        ['','','','','','√','','','','X'],
    ];

    return (
        <div className="sample">
            <Navbar />
            <main>
                <header>
                    <h1>Battleship Sample Game</h1>
                </header>

                <h3>Timer: <span className="red-text">00:05:32 </span><button className="restart-button">Restart</button></h3>

                <div className="main-container">
                    {/* Enemy board example */}
                    <div className="container">
                        <div className="text-box">
                            <p className="italics">Below is a sample of the enemy board where "X" represents your miss and "/" represents your hit.</p>
                        </div>

                        <div className="grid-container">
                            {/* Column headers */}
                            <div className="header"></div>
                            {gridHeaders.map((header, index) => (
                                <div className="header" key={index}>{header}</div>
                            ))}

                            {/* Rows */}
                            {rows.map((row, rowIndex) => (
                                <div key={rowIndex}>
                                    <div className="row-header">{rowIndex}</div>
                                    {row.map((cell, cellIndex) => (
                                        <div key={cellIndex} className={`cell ${cell === 'X' ? 'miss' : cell === '√' ? 'hit' : ''}`}>
                                            {cell}
                                        </div>
                                    ))}
                                </div>
                            ))}
                        </div>
                    </div>

                    {/* Player board example */}
                    <div className="container">
                        <div className="text-box">
                            <p className="italics">Below is a sample of the player board where "0" represents where your ships are and an "X" is where your ship was hit.</p>
                        </div>

                        <div className="grid-container">
                            {/* Column headers */}
                            <div className="header"></div>
                            {gridHeaders.map((header, index) => (
                                <div className="header" key={index}>{header}</div>
                            ))}

                            {/* Rows */}
                            {rows.map((row, rowIndex) => (
                                <div key={rowIndex}>
                                    <div className="row-header">{rowIndex}</div>
                                    {row.map((cell, cellIndex) => (
                                        <div key={cellIndex} className={`cell ${cell === '0' ? 'ship' : cell === 'X' ? 'miss' : ''}`}>
                                            {cell}
                                        </div>
                                    ))}
                                </div>
                            ))}
                        </div>
                    </div>
                </div>
            </main>

            <Footer />
        </div>
    );
}

export default Sample;
